function MonthArrow(props) {

    return (
        <div>
            {
                currentDays.map((day) => {
                    return (
                        <div className={"calendar-day" + (day.currentMonth ? " current" : "") + (day.selected ? " selected" : "") + (day.isToday ? " today" : "")}
                            onClick={() => props.changeCurrentDay(day)}>
                            <p>{day.number}</p>
                        </div>
                    );
                })
            }
        </div>
    );
}

export default MonthArrow;
